    false,nt"url": null,nt"notes": "The 2005 First Edition TIGER/Line files
    are an extract of selected geographic and cartographic information from the Census
    TIGER database. The geographic coverage for a single TIGER/Line file is a county
    or statistical equivalent entity, with the coverage area based on the latest available
    governmental unit boundaries. The Census TIGER database represents a seamless national
    file with no overlaps or gaps between parts. However, each county-based TIGER/Line
    file is designed to stand alone as an independent data set or the files can be combined
    to cover the whole Nation. The 2005 First Edition TIGER/Line files consist of line
    segments representing physical features and governmental and statistical boundaries.
    The files contain information distributed over a series of record types for the
    spatial objects of a county. There are 19 record types, including the basic data
    record, the shape coordinate points, and geographic codes that can be used with
    appropriate software to prepare maps. Other geographic information contained in
    the files includes attributes such as feature identifiers/census feature class codes
    (CFCC) used to differentiate feature types, address ranges and ZIP Codes, codes
    for legal and statistical entities, latitude/longitude coordinates of linear and
    point features, landmark point features, area landmarks, and area boundaries.",nt"license_title":
